import './index.css'

const Tabs = props => {
    const {key, tab, activeTab} = props
    const activeTabClass = activeTab === key ? 'active-tab': ''
    return (
        <p className={`tab-container ${activeTabClass}`} id={key}>
            {tab.displayText}
        </p>
    )
}

export default Tabs
